import React from 'react';
import './Services.css';

const Services = () => {
  const services = [
    {
      name: "Audit",
      icon: "fa-bar-chart",
      description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit."
    },
    {
      name: "Taxation",
      icon: "fa-line-chart",
      description: "Suspendisse diam mi, cursus quis placerat."
    },
    {
      name: "Consulting",
      icon: "fa-lightbulb-o",
      description: "Etiam semper diam vitae neque vestibulum, vitae aliquet arcu pretium."
    },
    {
      name: "Compliance",
      icon: "fa-file-text-o",
      description: "Fusce id mi diam. Nulla placerat, risus a facilisis ultrices."
    }
  ]

  return (
    <div className="services">
      {services.map((service, index) => (
        <div className="service-card" key={index}>
          <i className={`fa ${service.icon} service-icon`}></i>
          <h3 className="service-title">{service.name}</h3>
          <p className="service-description">{service.description}</p>
        </div>
      ))}
    </div>
  );
};

export default Services;
